import { createTheme } from "@material-ui/core";

export const themes = createTheme({
    palette: {
        primary: {
            main: '#f44336',
        },
        secondary: {
            main: '#3e3636',
            temp:'#ffffff',
        },
        error: {
            main: '#f3e5f5',
        }
    },
});
